Provides dinamic filtering of parts and exports from an underlying reflection-based catalog.

Example: 
var filtered = new FilteringReflectionCatalog(innerCatalog)
{
	// Filter all parts that don't have an "IsPublic" metadata
	PartFilter = part => 
		part.PartDefinition.Metadata.ContainsKey("IsPublic")
};
